import React from 'react';
import './'
const Service = ({ service }) => {
    const { name,img,price,description} = service;
    return (
        <div className="service-container">
            <img src={img} alt="" />
            <h3>{name}</h3>
            <h3>Price:{price}</h3>
            <p>{description}</p>
        </div>
    );
};

export default Service;
